import React, { useState, useEffect } from "react";
import GolfDataService from "../../services/golf";
import "./nextTournament.css";
import Button from "react-bootstrap/Card";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import Card from "react-bootstrap/Card";
import SafeAreaView from "react-bootstrap";
import Text from "react-bootstrap"
import View from "react-bootstrap";

function NextTournament() {
  const [nextTournament, setTournament] = useState({});

  useEffect(() => {
    getTournament();
  }, []);

  const getTournament = () => {
    GolfDataService.getNextTournament()
      .then((response) => {
        setTournament(response.data);
      })
      .catch((e) => {
        console.log(e);
      });
  };

  return (
    <div className="componentContainer">
      <Container fluid>
        <Row>
        <Col>
          <Container className="pageTextSection">

            
            <SafeAreaView>
        <View
          style={{
            justifyContent: 'center',
            backgroundColor: '#000000',
            height: '100%',
          }}>
          <Text
            style={{
              textAlign: 'center',
              color: '#ffffff',
            }}>
            Curated stats and hand-picked bets for every PGA Tour Event.
          </Text>
        </View>
      </SafeAreaView>
           
          </Container>
          
          </Col>
          <Col>
            <Container className="tournamentSection">
              <Card className="tournamentCard">
                <Card.Img variant="top" src="" />
                <Card.Body>
                  <Card.Title>Next PGA Event</Card.Title>
                  <Card.Text>
                    {nextTournament.Name}
                    <br></br>
                    {nextTournament.Venue}
                    <br></br>
                    Par: {nextTournament.Par}
                    <br></br>
                    Yards:  {nextTournament.Yards}
                  </Card.Text>
                  <Button variant="primary">Go somewhere</Button>
                </Card.Body>
              </Card>
            </Container>
          </Col>
        </Row>
        <Row>
          <Col>
            <Container className="algoPickSection">
              <Card  className="algoPickCard">
                <Card.Img variant="top" src="" />
                <Card.Body>
                  <Card.Title>AlgoPick</Card.Title>
                  <Card.Text>{nextTournament.Name}</Card.Text>
                  <Button variant="primary">Go somewhere</Button>
                </Card.Body>
              </Card>
            </Container>
          </Col>
        </Row>
        <Row>
          <Col>
            <Container className="honorableMentionsSection">
              <Card className="honorableMentionsCard">
                <Card.Img variant="top" src="" />
                <Card.Body>
                  <Card.Title>Mark Immelman's Best Bets</Card.Title>
                  <Card.Text>Market: Nationality<br></br>Selection: Jason Day Top Australian</Card.Text>
                  <Button variant="primary">Go somewhere</Button>
                </Card.Body>
              </Card>
            </Container>
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default NextTournament;
